## Remarks  
 <span data-ttu-id="7b147-103">Domyślnie słowo kluczowe pomocy dla klasy jest podawane przez <xref:System.Type.FullName%2A?displayProperty=nameWithType> wartość właściwości.</span><span class="sxs-lookup"><span data-stu-id="7b147-103">By default, the Help keyword for a class is given by the <xref:System.Type.FullName%2A?displayProperty=nameWithType> property value.</span></span> <span data-ttu-id="7b147-104">W przypadku elementów członkowskich słowo kluczowe pomocy jest podawane przez pełną nazwę typu, który zadeklarował właściwość, oraz samą nazwę właściwości.</span><span class="sxs-lookup"><span data-stu-id="7b147-104">For members, the Help keyword is given by the full name of the type that declared the property, plus the property name itself.</span></span>  
  
 <span data-ttu-id="7b147-105">Rozważmy <xref:System.Windows.Forms.Control.Text%2A?displayProperty=nameWithType> na przykład właściwość <xref:System.Windows.Forms.Button?displayProperty=nameWithType> w kontrolce.</span><span class="sxs-lookup"><span data-stu-id="7b147-105">For example, consider the <xref:System.Windows.Forms.Control.Text%2A?displayProperty=nameWithType> property on the <xref:System.Windows.Forms.Button?displayProperty=nameWithType> control.</span></span> <span data-ttu-id="7b147-106">Słowo kluczowe Class to "System. Windows. Forms. Button", <xref:System.Windows.Forms.Control.Text%2A?displayProperty=nameWithType> ale słowo kluczowe Property to "System. Windows. Forms. Control. text", <xref:System.Windows.Forms.Control.Text%2A?displayProperty=nameWithType> ponieważ <xref:System.Windows.Forms.Control?displayProperty=nameWithType> właściwość jest zadeklarowana w klasie, a nie <xref:System.Windows.Forms.Button?displayProperty=nameWithType> sama sama sama klasa ; <xref:System.Windows.Forms.Button?displayProperty=nameWithType> Klasa dziedziczy właściwość.</span><span class="sxs-lookup"><span data-stu-id="7b147-106">The class keyword is "System.Windows.Forms.Button", but the <xref:System.Windows.Forms.Control.Text%2A?displayProperty=nameWithType> property keyword is "System.Windows.Forms.Control.Text", because the <xref:System.Windows.Forms.Control.Text%2A?displayProperty=nameWithType> property is declared on the <xref:System.Windows.Forms.Control?displayProperty=nameWithType> class, rather than the <xref:System.Windows.Forms.Button?displayProperty=nameWithType> class itself; the <xref:System.Windows.Forms.Button?displayProperty=nameWithType> class inherits the property.</span></span>  
  
 <span data-ttu-id="7b147-107">Z kolei <xref:System.Windows.Forms.Button.DialogResult%2A?displayProperty=nameWithType> właściwość jest zadeklarowana <xref:System.Windows.Forms.Button?displayProperty=nameWithType> w klasie, więc jego słowo kluczowe to "System. Windows. Forms. Button. DialogResult".</span><span class="sxs-lookup"><span data-stu-id="7b147-107">By contrast, the <xref:System.Windows.Forms.Button.DialogResult%2A?displayProperty=nameWithType> property is declared on the <xref:System.Windows.Forms.Button?displayProperty=nameWithType> class, so its keyword is "System.Windows.Forms.Button.DialogResult".</span></span>  
  
 <span data-ttu-id="7b147-108">Gdy system pomocy Pobiera słowa kluczowe, najpierw <xref:System.ComponentModel.Design.HelpKeywordAttribute>zobaczymy.</span><span class="sxs-lookup"><span data-stu-id="7b147-108">When the Help system gets the keywords, it will first look at <xref:System.ComponentModel.Design.HelpKeywordAttribute>.</span></span> <span data-ttu-id="7b147-109">Na poziomie klasy zwróci ciąg określony przez <xref:System.ComponentModel.Design.HelpKeywordAttribute>.</span><span class="sxs-lookup"><span data-stu-id="7b147-109">At the class level, it will return the string specified by the <xref:System.ComponentModel.Design.HelpKeywordAttribute>.</span></span> <span data-ttu-id="7b147-110">Nie będzie on używany dla elementów członkowskich typu, które nadal będą odzwierciedlać rzeczywistą pełną nazwę typu deklarującego oraz nazwę elementu członkowskiego.</span><span class="sxs-lookup"><span data-stu-id="7b147-110">This will not be used for members of the type in question, which will still reflect the declaring type's actual full name, plus the member name.</span></span> <span data-ttu-id="7b147-111">Ten atrybut obsługuje klasy o jednoznacznie określonym typie, które mają skojarzoną wspólną dokumentację, ale odrębne identyfikatory pomocy.</span><span class="sxs-lookup"><span data-stu-id="7b147-111">This attribute supports strongly typed classes that have associated common documentation but distinct Help IDs.</span></span>  
  
   
  
## Examples  
 <span data-ttu-id="7b147-112">Poniższy przykład kodu pokazuje, jak zastąpić to zachowanie systemu pomocy przez umieszczenie atrybutu w samym elemencie członkowskim.</span><span class="sxs-lookup"><span data-stu-id="7b147-112">The following code example shows how to override this Help system behavior by placing the attribute on the member itself.</span></span> <span data-ttu-id="7b147-113">Są to słowa kluczowe dla następującej klasy `DemoComponent`:</span><span class="sxs-lookup"><span data-stu-id="7b147-113">These are the keywords for the following class, called `DemoComponent`:</span></span>  
  
-   <span data-ttu-id="7b147-114">Class — słowo kluczowe`System.ComponentModel.Component`: "`DemoNamespace.DemoComponent`" ()</span><span class="sxs-lookup"><span data-stu-id="7b147-114">Class keyword: "`System.ComponentModel.Component`" (`DemoNamespace.DemoComponent`)</span></span>  
  
-   <span data-ttu-id="7b147-115">Property1 — słowo kluczowe`DemoNamespace.DemoComponent.Property1`: "" (wartość domyślna)</span><span class="sxs-lookup"><span data-stu-id="7b147-115">Property1 keyword: "`DemoNamespace.DemoComponent.Property1`" (default)</span></span>  
  
-   <span data-ttu-id="7b147-116">Property2 — słowo kluczowe`SomeNamespace.SomeOtherClass.Property2`: "`DemoNamespace.DemoComponent.Property2`" ()</span><span class="sxs-lookup"><span data-stu-id="7b147-116">Property2 keyword: "`SomeNamespace.SomeOtherClass.Property2`" (`DemoNamespace.DemoComponent.Property2`)</span></span>  
  
```csharp  
[HelpKeywordAttribute(typeof(Component))]  
public class DemoComponent : Component  
{  
    public string Property1  
    {  
        get  
        {  
            return "";  
        }  
    }  
  
    [HelpKeywordAttribute("SomeNamespace.SomeOtherClass.Property2")]  
    public string Property2  
    {  
        get  
        {  
            return "";  
        }  
    }  
}  
```  
  
